import React from "react";

import axios from "axios";
import { useState, useEffect } from "react"
import { useParams } from "react-router-dom";


function App (){
  const {id} = useParams();

  const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/"+`${id}`+"/question";

  return (
    <>
      <h1> {QUIZ_API_BASE_URL}</h1>
    </>
  );
}

export default App
